import { connect  } from "react-redux";

class Timeline extends Component{
  render(props){
    const {
      // ...props,
      error,
      isPending,
      data: experiences,
    }=this.exp 
    // = useFetch("http://localhost:8000/experiences/");

    return (
      <div>
        <div>
          <h2>{props.year}</h2>
          <hr />
        </div>
        {error && <div>{error}</div>}
        {isPending && <div>Loading...</div>}
        {experiences && (
          <ExperienceCard
